# Generate fake book titles
def GenerateFakeTitles(numTitles):
    fakeTitles = []
    for x in range(numTitles):
        template = random.choice(formats)
        title = template.format(
            adjective=random.choice(adjectives),
            noun=random.choice(nouns),
            verb=random.choice(verbs)
        )
        fakeTitles.append(title)
    return fakeTitles


def GenerateFakeBooks(numBooks, titles, authors, publishers):
    fakeBooks = []
    genres = ["fiction", "mystery", "romance", "thriller", "fantasy"]
    for x in range(numBooks):
        bookData = {}
        bookData['title'] = titles[x]
        bookData['author_name'] = authors[x]
        bookData['isbn'] = random.randint(10**12, 10**13 - 1)
        bookData['first_publish_year'] = random.randint(1900, 2025)
        bookData['publisher'] = publishers[random.randint(0, len(publishers)-1)]
        bookData['genre'] = genres[random.randint(0,len(genres)-1)]
        fakeBooks.append(bookData)
    return fakeBooks


# Save dataset to CSV
def SaveToCsv(books, filePath):
    with open(filePath, mode='w', newline='', encoding='utf-8') as file:
        writer = csv.writer(file, delimiter=';')
        writer.writerow(["Title", "Author", "ISBN", "PublishYear", "Publisher", "Genre", "Label"])
        for book in books:
            writer.writerow([book.get('title'), book.get('author_name'), book.get('isbn'), book.get('first_publish_year'), book.get('publisher'), book.get('genre'), 0])  # Label 1 for legit titles


if __name__ == "__main__":
    # Generate titles
    numberOfTitles = 10000
    fakeTitles = GenerateFakeTitles(numberOfTitles)

    books = GenerateFakeBooks(numberOfTitles, fakeTitles, authors, publishers)


    # File path
    csvPath = "fake_book_titles.csv"

    # Save to CSV
    SaveToCsv(books, csvPath)
    print(f"Dataset with {numberOfTitles} fake titles saved to {csvPath}")
